import React from 'react';
import { getImageUrl } from './component/user';

function Avatar(size , person){
    return(
        <img 
        className="avatar"
        // src="https://i.imgur.com/1bX5QH6.jpg"
        // alt='person alia'
        src={getImageUrl(person)}
      alt={person.name}
        width={size}
        height={size}
        />
    );
}
export default function Profile(){
    return(
        <div>
            <Avatar 
             size = {100}
             person = {{
                name: 'Ali',
                imageid : 'ifjrk'
             }}
            />
            <Avatar 
             size = {90}
             person = {{
                name: 'Wahab',
                imageid : 'ifjrkhg'
             }}
            />
            <Avatar 
             size = {70}
             person = {{
                name: 'Naemaa',
                imageid : 'ifjrfffk'
             }}
            />
        </div>
    );
}
